	public static int lengthOfLongestSubstring2(String s) {
		if(s == null || s.length() == 0)
			return 0;
		int begin = 0;
		int end = 1;
		int maxLength = 1;
		while(end < s.length()) {
			char currentChar = s.charAt(end);
			String prevStr = s.substring(begin,end);
			if(prevStr.contains(""+currentChar)) {
				begin++;
			}else {
				end++;
			}
			maxLength = Math.max(maxLength, end - begin);
		}
		return maxLength;
	}

	public static int lengthOfLongestSubstring3(String s) {
			int len = s.length();
	        if (s == null || len == 0) return 0;

	        int[] table = new int[256];
	        Arrays.fill(table, -1);

	        int maxlen = 1;
	        int begin = 0, end = 1;
	        table[s.charAt(0)] = 0; //important!
	        while (end < len) {
	            char endch = s.charAt(end);
	            if (table[endch] >= begin) {
	                begin = table[endch] + 1;
	            }
	            table[endch] = end;
	            maxlen = Math.max(maxlen, end-begin+1);
	            end++;
	        }
	        return maxlen;
	}

	/**
	 * 方法1循环，时间耗费过多
	 * */
	public static int lengthOfLongestSubstring(String s) {
		if(s == null || s.length() == 0)
			return 0;
		int result = 1;
		StringBuilder tempStr;
		for(int i = 0; i < s.length(); i++) {
			tempStr = new StringBuilder();
			for(int j = i; j < s.length(); j++) {
				if(!tempStr.toString().contains(""+s.charAt(j))) {
					tempStr.append(s.charAt(j));
				}else {
					int value = tempStr.toString().length();
					if(value > result) {
						result = value;
					}
					break;
				}
			}
		}
		return result;
	}
